다 좋은데&hellip;
전기 포트 세척을 잘 안해요&hellip; 세번 가봤는데 세번 다 포트에 불순물이 떠다닙니다&hellip; 물을 끓이면 생기는 그 하얀색? 가루같은게 돌아다닙니다
옛날에 차를 마시기 시작한 이유가 수질이 좋지않아서 물맛이 좋지않기 때문에 차로 마신다는 설이 있는데 굳이 그것까지 쫓아갈 필요는 없지 않을까요&hellip;
다기 중에 개완은 자기라서 괜찮은데 다관(명칭이 기억이 안나네요)은 피하시는걸 추천합니다 잡내가 좀 나요.
저 부분만 주의하면 차도 많고 설명도 잘 해주시고 정말좋습니다

