'눈탱이 감탱이'에서 눈탱이 맞았습니다.

주말 60분 이용권(음료포함)이 인당 2만원입니다. 딸이랑 둘이 들어갔다가 칠흑같은 어둠 속에 앉아 있으니 둘다 너무답답하고 숨이 막혀 그냥 나왔습니다. (매장의 문제가 아니라 우리 부녀의 심리적 문제임을 분명히 합니다). 그냥 나와서 1초도 안있었으니 음료빼고 환불을 조심스레 요청했더니...안된다는거에요. 분명히 환불규정을 못들었는데..오히려 본인이 시각장애자라고 주장하시는 사장님이 '까폐의 목적이 시각장애인의 어려움을 체험하기 위한 곳이며, 극장에서 한번 들어가면 환불되냐'며 흥분하시는거에요. 그러면서 환불규정은 문앞에 붙였다라고 얘기해서 봐도 못찾겠더라구요. 시각장애인이라는 사장님과 목소리 높이는게 경우가 아닌거 같아 그냥 언짢았지만 4만원 기부했다고 생각하고 나왔습니다.&nbsp; &nbsp;&nbsp;


뭐 색다른 경험을 원하시면 가시는 걸 추천드리지만(전 천막만 만져보고 나와 할 말은 없습니다만..) 한 두가지 건의 드리지만, 분명히 폐쇄공포증 증세가 있는 분들도 있으니 결제전에 환불규정을 얘기해줬으면 합니다. 10초도 안되서 나온 사람에게 보이지도 않는 안내문을 추후에 얘기하는건 지나친 상흔 같습니다. 그리고 사장님도 장애인이시다고 하시나 어디까지 업주시니 그걸 빌미로 너무 손님들에게 고압적이지 않으셨으면 좋겠습니다.새로운 테마로 열심히 사시는 분이시기 때문에 더 큰 발전을 위해 제언합니다.

